import React from 'react';
import { Container } from '@mui/material';
import voteImage from '../images/vote.jpg'; // Adjust the path based on your folder structure

const LandingPage = () => {
  return (
    <Container
      maxWidth="lg"
      sx={{
        textAlign: 'center',
        // Remove margin top and bottom to make the image full screen
        mt: 0,
        mb: 0,
        backgroundImage: `url(${voteImage})`, // Use the imported image
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        height: '100vh', // Full height
        width: '100vw', // Full width
        position: 'absolute', // Position absolutely for full coverage
        top: 0,
        left: 0,
        zIndex: -1, // Send it to the back
      }}
    >
      {/* No text content */}
    </Container>
  );
};

export default LandingPage;
